Decks of the week
This week deck choice is fulfilling a promise I did on Reddit



As cards are released quite frequently it’s obvious that some decks takes a seat back, sometimes because of power-creep, but sometimes, people just don’t have the time and want to focus on the new toys.
With the release of BandleCity while there are of course some top-tier deck that are above the rest I don’t think I’m in the minority by saying this is overall an healthy meta with lots and lots of option.
This week I want to highlight something old, maybe so old that may result fresh for some players: Lucian / Zed
With a respectable win rate of 58.5% (even accounting the small sample size), this wants to be a reminder that are often forgotten options are still worth exploring.
Note: I’m not Master but I’m currently having fun and discrete success with Nightfall, for the lower ranks like me my message this week is: “Play your deck and have fun! This is a good moment to let your deck building prowess carry you.”





